import './App.css';

import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import LoginRegistration from './Componants/Login/LoginRegistration';
import Registration from './Componants/Login/Registration';
import Home from './Componants/Home';
import About from './Componants/About';
import MainHeader from './Componants/MainHeader';
import React from 'react';

function App() {
  // let match = useMatch();
  return (

    <Router>
      <React.Fragment>
      <Home />
      <Routes>
          <Route path="/" elements={<Home />}/>
          <Route path="/About Us" elements={<About />}></Route>
        <Route path="/Login"><LoginRegistration /></Route>
        <Route path="/Registration"><Registration /></Route>
      </Routes>
    </React.Fragment>
      </Router >


  );
}

export default App;
